import React, { Component } from 'react';

import { Butt  } from '../components/Butt';
import { Head3 } from '../styles/Head3';
import { Head4 } from '../styles/Head4';

import Info from '../components/Info';

export default class Abou extends Component {
	render() {
		return (

		<section>
		  <div className="abou-img"></div>	        
	        <div className="container">
	          <div className="row">
	            <div className="col-10 mx-auto col-md-8 mt-4">
	              <Head3 className="text-center text-capitalize"> live interactive audience participation</Head3> 
	              <Head4 className="text-center text-capitalize"> Engage your audience or class in real time</Head4> 
	              <div className="btn-upper text-center ">
	                <form>            
	                  <Butt className="btn-upper" type="submit"> 
	                    Learn more 
	                  </Butt>
	                </form>       
	              </div>                      
	            </div>
	          </div>
	        </div>
	         <Info /> 

	    </section>

		);
	}
}
